contracts/KlineStorage.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract KlineStorage {
    address public owner;

    enum Interval {
        MIN1, MIN5, MIN15, MIN30, HOUR1, HOUR4, HOUR12, DAY1
    }

    struct Candle {
        uint256 openTime;
        uint256 open;
        uint256 high;
        uint256 low;
        uint256 close;
        uint256 volume;
        bool isClosed;
    }

    mapping(Interval => Candle[]) public candles;

    bool public initialized;

    modifier onlyOwner() {
        require(msg.sender == owner, "Not owner");
        _;
    }

    function initialize(address _owner) external {
        require(!initialized, "Already initialized");
        owner = _owner;
        initialized = true;
    }

    function addCandle(Interval interval, Candle memory candle) external onlyOwner {
        candles[interval].push(candle);
    }

    function getCandles(Interval interval) external view returns (Candle[] memory) {
        return candles[interval];
    }
}

